import React from 'react';
import PropTypes from 'prop-types';

function Food({ name, image, rating }) {
  return (
    <div>
      <h1>I like {name}</h1>
      <h4>{rating} / 5</h4>
      <img src={image} alt="" />
    </div>
  );
}

const foodILike = [
  {
    id: 1,
    name: 'kimchi',
    img:
      'data:image/jpeg;base64,',
    rating: 4.5,
  },
  {
    id: 2,
    name: 'kimbap',
    img:
      'data:image/jpeg;base64,',
    rating: 4,
  },
];

Food.propTypes = {
  name: PropTypes.string.isRequired,
  image: PropTypes.string.isRequired,
  rating: PropTypes.number.isRequired,
};

function App() {
  return (
    <div>
      {foodILike.map((dish) => (
        <Food
          key={dish.id}
          name={dish.name}
          image={dish.img}
          rating={dish.rating}
        />
      ))}
    </div>
  );
}

export default App;
